import Spacer from "../Spacer";
const Logo: React.FC = () => {
  return (
    <div className="bd-bottom ">

      <div className="flex-row-center-center">
        <StyledLogoImg src={logo} />
      </div>

    </div>
  );
};
const StyledLogo = styled.img`
  width: 148px;
  height: 44px;
  @media (max-width: 768px) {
  }
`;

const StyledLogoImg = styled.img`
  width: 148px;
  height: 44px;
  @media (max-width: 768px) {
  }
`;

export default Logo;
